DROP TABLE IF EXISTS `rents`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `rents` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int unsigned NOT NULL COMMENT 'Link on user owner of housing',
  `description` text CHARACTER SET utf8 COLLATE utf8_unicode_ci COMMENT 'House description',
  `addresses_id` int unsigned NOT NULL COMMENT 'Link on address',
  `price` decimal(8,2) NOT NULL COMMENT 'Price one day/night',
  `created_at` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'Time create record',
  `updated_at` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT 'Time update record',
  PRIMARY KEY (`id`),
  KEY `rents_user_id_fk` (`user_id`),
  KEY `rents_addresses_id_fk` (`addresses_id`),
  KEY `rents_price` (`price`),
  CONSTRAINT `rents_addresses_id_fk` FOREIGN KEY (`addresses_id`) REFERENCES `addresses` (`id`) ON DELETE RESTRICT,
  CONSTRAINT `rents_user_id_fk` FOREIGN KEY (`user_id`) REFERENCES `users` (`id`) ON DELETE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Addresses for registred users or rent out housing';
/*!40101 SET character_set_client = @saved_cs_client */;

